style.css:
/* Apply black background and white text to the body */
body {
    background-color: #000000 !important;
    color: #ffffff !important;
}

/* Apply black background and white text to common elements */
div, span, header, footer, section, article, nav, aside {
    background-color: #1a1a1a !important; /* Dark gray background */
    color: #ffffff !important;
}

/* Change link colors */
a {
    color: #1E90FF !important; /* Light blue color for links */
}

/* Apply dark gray background and white text to form elements */
input, textarea, button, select {
    background-color: #333333 !important; /* Medium dark gray background */
    color: #ffffff !important;
    border-color: #555555 !important; /* Darker gray border */
}

/* Apply black background and white text to tables */
table, th, td {
    background-color: #1a1a1a !important; /* Dark gray background */
    color: #ffffff !important;
    border-color: #333333 !important; /* Medium dark gray border */
}

/* Apply dark gray borders to elements with borders */
* {
    border-color: #333333 !important; /* Medium dark gray border */
}
